import React from "react";
import { View, Text } from "react-native";

const WeatherItem = () => {
    return(
        <View>
            <Text></Text>
        </View>
    )
}

const DateTime = () => {
  return (
    <View>
      <View>
        <View>
          <Text>12:12</Text>
        </View>
        <View>
          <Text>Vendredi 30 Juin</Text>
        </View>
        <View>

        </View>
      </View>
      <View>
        <Text>France, Saint-Nazaire</Text>
        <Text>4.22N 50E</Text>
      </View>
    </View>
  );
};

export default DateTime;
